properties.script:
var newForms = new java.util.ArrayList()
var dbConn = DatabaseConnectionFactory.createDatabaseConnection($('DB_DRIVER'), $('DB_URL'), $('DB_USER'), $('DB_PASS'));

try {

  var tables = $('TABLE_SEQUENCE');
  var metadata = $('TABLE_METADATA');
  var batchSize = $('BATCH_SIZE');
  var processed = 0;

  logger.info("polling database for unprocessed forms...");

  for (var t = 0; t < tables.length && processed < batchSize; t++) {

    var tableName = tables[t];
    var tableMeta = metadata[tableName];
    var eventName = tableMeta.event;
    var aliases = tableMeta.alias || {};

    var processedForTable = 0;

    var queryResults = dbConn.executeCachedQuery("SELECT * FROM " + tableName + " WHERE PROCESSED_BY_MIRTH IS NULL ORDER BY COLLECTION_DATE_TIME LIMIT " + (batchSize - processed));

    while (queryResults.next()) {
      // emit one Mirth event per row in the result set
      var resultXML = resultSetToXml(queryResults, "<" + eventName + " event='" + eventName + "' table-name='" + tableName + "'/>", aliases);
      newForms.add(resultXML.toString());

      // mark each row as processed
      var uri = resultXML["_uri"].toString();
      var result = dbConn.executeUpdate("UPDATE " + tableName + " SET PROCESSED_BY_MIRTH = true WHERE _URI = '" + uri + "'");

      processedForTable += 1;
    }

	if (processedForTable > 0) {
	  processed += processedForTable;
	  logger.info('processed ' + processedForTable + " from " + tableName + ", batch total: " + processed);
	}
  }
  
} finally {
  dbConn.close();
}

return newForms;

